[Penthouse.] Alanah Rae (Military Feature 2: Full Service Nurse)


Ken was shot in the arm by accident while training. It's not a very painful injury, but they had to put him out because he was whining so much. As he comes to he's pleased to see a sexy nurse attending to him. She's not a very good nurse so it's lucky she happens to be so pretty. And more than that she's what they call a full service nurse.


